import com.itextpdf.text.DocumentException;
import com.lowagie.text.Image;
import com.lowagie.text.pdf.PdfContentByte;
import com.lowagie.text.pdf.PdfReader;
import com.lowagie.text.pdf.PdfStamper;
import java.io.ByteArrayOutputStream;
import java.io.File;
import java.net.URL;
import java.io.IOException;

public class Stamper {

    public static final String SRC = "/Users/haoliu350/Desktop/Timesheet.pdf";
    public static final String DEST = "/Users/haoliu350/Desktop/Timesheet55.pdf";
    public static final String IMG = "http://gitlab.itextsupport.com/itext/sandbox/raw/master/resources/images/itext.png";
    public static final String byteArray = "";

    public static void main(String[] args) throws IOException, DocumentException {
        File file = new File("/Users/haoliu350/Desktop/byteArray_wm001.pdf");
        file.getParentFile().mkdirs();
        new Stamper().stampDocument(byteArray.getBytes());
    }

    public byte[] stampDocument(byte[] orig) {
        try{
            PdfReader pdfReader = new PdfReader(orig);
            ByteArrayOutputStream baos = new ByteArrayOutputStream();
            PdfStamper pdfStamper = new PdfStamper(pdfReader, baos);
            Image image = Image.getInstance(new URL("http://gitlab.itextsupport.com/itext/sandbox/raw/master/resources/images/itext.png"));
            image.setAbsolutePosition(70f, 10f);
            image.scalePercent(40f);
            for(int i=1; i<= pdfReader.getNumberOfPages(); i++){
                PdfContentByte content = pdfStamper.getUnderContent(i);
                content.addImage(image);
            }

            pdfStamper.close();

            return baos.toByteArray();
        }
        catch (IOException e) {
            e.printStackTrace();
            return null;
        }catch (Exception e) {
            e.printStackTrace();
            return null;
        }
    }

    public void stampDocument2(String src) {
        try{
            PdfReader pdfReader = new PdfReader(src);
            ByteArrayOutputStream baos = new ByteArrayOutputStream();
            PdfStamper pdfStamper = new PdfStamper(pdfReader, baos);
            Image image = Image.getInstance(new URL(IMG));
            image.setAbsolutePosition(70f, 10f);
            image.scalePercent(40f);
            for(int i=1; i<= pdfReader.getNumberOfPages(); i++){
                PdfContentByte content = pdfStamper.getUnderContent(i);
                content.addImage(image);
            }

            pdfStamper.close();

            //return baos.toByteArray();
            System.out.println(baos.toByteArray().toString());
        }
        catch (IOException e) {
            e.printStackTrace();
            //return null;
        }catch (Exception e) {
            e.printStackTrace();
            //return null;
        }
    }
}